package leetcode;

import java.util.HashSet;
import java.util.Set;
import java.util.logging.Level;
import java.util.logging.Logger;

public class MaxNumVowels {
	public static Logger logger = Logger.getLogger(MaxNumVowels.class.getName());
	
	public static void main(String args[])	{
		//String s = "";
		//String s = "abciiidef";
		logger.log(Level.INFO, ": " + maxVowels("aeiou", 2));
	}

    public static int maxVowels(String s, int k) {
    	long start = System.currentTimeMillis();
    	Set<Character> vowels = new HashSet();
    	vowels.add('a');
    	vowels.add('e');
    	vowels.add('i');
    	vowels.add('o');
    	vowels.add('u');
    	//logger.setLevel(Level.INFO);
    	//logger.log(Level.INFO, "Length : " + s.length());
    	int maxVowelCnt = 0;
		int vowelCnt = 0;
		String s2 = s.substring(0, k);
		for (char c : s2.toCharArray())	{
			if (vowels.contains(c))	{
				++vowelCnt;
			}
		}
		maxVowelCnt = vowelCnt;
    	for (int i = 0; i <= s.length()-k; ++i)	{
    		if (i ==0)	continue;
    		String s1 = s.substring(i, i+k);
    			//logger.log(Level.INFO, ":" + s.charAt(i-1));
			if (vowels.contains(s.charAt(i-1)))	{
				//logger.log(Level.INFO, ":reducing vowel : " + s.charAt(i-1));
				vowelCnt--;
				//logger.log(Level.INFO, ":reducing vowel : " + s.charAt(i-1) + ":"+vowelCnt);
			}
			if (vowels.contains(s.charAt(i+k-1)))	{
				//logger.log(Level.INFO, ":increasing vowel : " + s.charAt(i+k-1) + ":"+vowelCnt);
				vowelCnt++;
			}
			//logger.log(Level.INFO, ":" + s.charAt(i+k-1) + ":"+vowelCnt);
    		if (vowelCnt > maxVowelCnt)	{
    			maxVowelCnt = vowelCnt;
    		}
    		//logger.log(Level.INFO, s1 + " : " + vowelCnt);
    		//vowelCnt = 0;
    	}
    	logger.log(Level.INFO, "" + (System.currentTimeMillis() - start));
        return maxVowelCnt;
    }
    //8003
}
